script: |
  super -f text -I q568.spq | sort > q568.out

inputs:
  - name: q568.spq
    data: |
      SELECT - 48 + - 20 * - col1 FROM tab1 (FORMAT parquet) AS cor0 WHERE + ( col1 ) - col0 NOT BETWEEN + + col0 AND + - col1 + + 41;
  - name: tab1

outputs:
  - name: q568.out
    data: |
      232
      52
      892
